interface Mpld3VisualizationProps {
    htmlContent: string;
    width?: string;
    height?: string;
  }
  
const Mpld3Visualization: React.FC<Mpld3VisualizationProps> = ({ 
    htmlContent, 
    width = '100%', 
    height = '500px' 
}) => {
    const containerRef = useRef<HTMLDivElement>(null);
  
    useEffect(() => {
      if (containerRef.current) {
        // Clear any existing content
        containerRef.current.innerHTML = '';
        
        // Create a temporary div to parse the HTML
        const tempDiv = document.createElement('div');
        tempDiv.innerHTML = htmlContent.trim();
        
        // Extract the SVG and script elements
        const svgElement = tempDiv.querySelector('svg');
        const scriptElements = tempDiv.querySelectorAll('script');
        
        if (svgElement) {
          // Append the SVG to the container
          containerRef.current.appendChild(svgElement);
          
          // Execute any mpld3 scripts
          scriptElements.forEach(script => {
            if (script.textContent) {
              try {
                // Use eval carefully - in this case, it's from a trusted source (mpld3)
                eval(script.textContent);
              } catch (error) {
                console.error('Error executing mpld3 script:', error);
              }
            }
          });
        }
      }
    }, [htmlContent]);
  
    return (
      <div 
        ref={containerRef}
        style={{ 
          width, 
          height, 
          overflow: 'auto',
          border: '1px solid #ddd',
          borderRadius: '4px',
          padding: '10px'
        }}
      />
    );
  };
  
